import React, { useState, useEffect } from 'react';
import  GoogleMapReact from 'google-map-react';
import  Marker from 'google-map-react';



const PartnersMaps = () => {
  const [data, setData] = React.useState({

    error: '',
    data: [],
    temp: [],
    error: null,
    search: null,
    id:1,
    array: [],
    center: {
      lat: 33.886917,
      lng: 9.537499
    },
    zoom: 11


  });
  const AnyReactComponent = ({ text }) => <div>{text}</div>;
  const getData = async () => {
    const url = `https://api.foodealzapi.com/restaurants`;
    await fetch(url)
      .then(res => res.json())
      .then(res => {
        console.log(" le resultat est :", res);

        setData({
          ...data,
          data: res,
          temp: res,
        });

      })

      .catch(error => {
        setData({
          ...data,
          error: 'Error Loading content',
        })
      })
  };

  console.log("les partenaires sont :", data.data);
  useEffect(() => {
    getData()
  }, [])




  return (
    // Important! Always set the container height explicitly
    <div style={{ height: '100vh', width: '100%' }}>
      <GoogleMapReact
        bootstrapURLKeys={{ key: `AIzaSyD1lN2ArTGGjhdZrR1JI5bXj58JU9V5iUE` }}
        defaultCenter={data.center}
        defaultZoom={data.zoom}
      >
        <AnyReactComponent
          lat={data.center.lat}
          lng={data.center.lng}

        />


        <Marker  position={{ lat:33.886917 , lng:9.537499  }}
        />




      </GoogleMapReact>
    </div >
  );

}

export default PartnersMaps;














